import { useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
import PlaidToken from "./PlaidToken";
import axios from "axios";

export default function In(){
    const [accessToken,setAccessToken]=useState()

    function getToken(x){
      setAccessToken(x)
    }

    function getTransactions(){
      let transactions=""
      const url = `http://localhost:3500/plaid/transactions?accessTokens=${accessToken.data.accessToken}`;
      fetch(url, {
          method: 'GET',
          headers: {
              'Authorization': `Bearer ${accessToken.data.accessToken}`,
              'Content-Type': 'application/json'
          }
      })
      .then(response => response.json())
      .then(data => console.log(data))
      .catch(err => console.log(err));
    }

    return(
        <div className='in'>
            <h1>hi</h1>
           <PlaidToken getToken={getToken}></PlaidToken> 
           {accessToken?<button onClick={getTransactions}>get Transactions</button>:null}
        </div>
    )
}
